import React from 'react'
import {connect} from 'react-redux'

const ModuleList = ({myModules}) =>
    <div>
        <h2>Modules {myModules}</h2>
    </div>

const stpm = (state) =>{
    return{
        myModules: state.modules
    }
}
const dtpm = (dispatch) =>{}

export default connect(stpm,dtpm)(ModuleList)
